import React, { Component } from "react";
import { connect } from "react-redux";
import CircleChart from "./CircleChart";

class SizeChart extends Component {
  constructor(props) {
    super(props);

    this.state = {
      first: ["", ""],
      second: ["", ""],
      third: ["", ""],
      fourth: ["", ""],
      fifth: ["", ""],
    };
  }

  componentDidUpdate(prevProps) {
    if (this.props.data !== prevProps.data) {


      const data = this.props.data;

      console.log(data);

      this.setState({
        first: [data[0].count, data[0].numberOfMembers],
        second: [data[1].count, data[1].numberOfMembers],
        third: [data[2].count, data[2].numberOfMembers],
        fourth: [data[3].count, data[3].numberOfMembers],
        fifth: [data[4].count, data[4].numberOfMembers]
      });
    }
  }

  render() {
    const title = this.props.title;
    const data = [
      {
        name: "Group A",
        value: this.state.first[0]
      },
      {
        name: "Group B",
        value: this.state.second[0]
      },
      {
        name: "Group C",
        value: this.state.third[0]
      },
      {
        name: "Group D",
        value: this.state.fourth[0]
      }
      ,
      {
        name: "Group D",
        value: this.state.fifth[0]
      }
    ];

    const colors = [
      "#2964d8",
      "#67b6ed",
      "#75ad57",
      "#d9ae6c",
      "#9edlel",
      "#42cb7d"
    ];

    return (
      <div>
        <CircleChart title={title} data={data} colors={colors} />
      </div>
    );
  }
}

export default SizeChart;
